import React,{useEffect ,useState} from 'react'

function App() {
  const [count ,setCount] =useState(0)
  useEffect(() => {
document.title =`count`
  }, [count]);
  return (
    <div>
      <div>
        <p>{count}</p>
        <button onClick={() =>{setCount(count+1)}}></button>
      </div>
    </div>
  )
}

export default App
